import logo from './logo.svg';
import './App.css';

function App() {

  document.addEventListener('DOMContentLoaded', function(){
    document.querySelector('.invite-btn').style.left = '50vw';
    document.querySelector('.invite-btn').style.left = '50vw';
  })

  return (
    <div className="App">
      <header className="App-header">
        <div className='home'>
          <button className='invite-btn'>
            View Matching
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
